prisma_schema:
datasource db {
  provider = "mysql"
  url      = "mysql://tuazp9duw05i1u6l6ixy:pscale_pw_2lWWuuu0YjX4JcGrwtILrnBl7bMJCzlTdb8Fc6aEk4k@aws.connect.psdb.cloud/backend?sslaccept=strict"
}

model AdminAction {
  id         String                 @id
  actionType AdminAction_actionType
  timestamp  DateTime
  details    Json
  userId     String
}

model Policy {
  id         String            @id
  policyType Policy_policyType
  status     Policy_status
  details    Json
  userId     String
}

model User {
  id       String    @id
  username String
  password String
  role     User_role
}

enum AdminAction_actionType {
  POLICY_CREATION
  POLICY_MODIFICATION
  POLICY_CANCELLATION
  USER_REGISTRATION
}

enum Policy_policyType {
  LIFE_INSURANCE
  HEALTH_INSURANCE
  AUTO_INSURANCE
}

enum Policy_status {
  ACTIVE
  PENDING
  LAPSED
  CANCELLED
}

enum User_role {
  ADMIN
  POLICY_HOLDER
  AGENT
  UNDERWRITER
}
